import items from './../exp.json';
import logo from './../logo/call.png';
import './skills.css';

function Skills() {
    console.log(Object.entries(items)[10]);
    return (
        <div>
            <div className="flip-card">
                <div className="flip-card-inner">
                    <div className="flip-card-front">
                        <img src={logo} alt="Avatar" width="300px" height="300px" />
                    </div>
                    <div className="flip-card-back">
                        <h1>John Doe</h1>
                        <p>Architect & Engineer</p>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Skills;
